Former boxer Reno is bumming around Europe when he takes up with the rich and widowed Anne. When Reno starts getting to know Anne better, he finds that her late husband is connected to a nefarious fascist organization with its sights set on ruling Europe. After the heads of this group - Dr. Morillon and Leschenhaut - snatch Anne's young son, Paul, Reno finds himself in a dangerous situation with his new lover


